from app.ForeignExchange.models 			import *
class ExtendModuleEx(object):

	def getDashboardUnauth(self):
		""" Syntax = { 'Label': ['URL', 'TABLE', 'CONDITION']}"""
		# #ForeignExchange
		SellForeign = [MKT_FOREIGN_EXCHANGE_INAU.ID.like('%'+'SF'+'%')]
		BuyForeign = [MKT_FOREIGN_EXCHANGE_INAU.ID.like('%'+'BF'+'%')]

		DashboardConf 	= {
				'Customer':					['CustomerEx',					'MKT_CUSTOMER_INAU' 					],
				'Loan Application':			['LoanApplicationEx',			'MKT_LOAN_APPLICATION_INAU'				],
				'Loan Contract':			['LoanContractEx',				'MKT_LOAN_CONTRACT_INAU'				],
				'Buy Foreign Currency':		['BuyForeignEx',				'MKT_FOREIGN_EXCHANGE_INAU',		BuyForeign],
				'Sell Foreign Currency':	['SellForeignEx',				'MKT_FOREIGN_EXCHANGE_INAU',		SellForeign],
				'Source of Income':			['SourceIncome',				'MKT_SOURCE_INCOME_INAU'				],
				
			}
		
		return DashboardConf

	def setListUrlExtend(self):
		""" Syntax = { "OLD_URL" : ['NEW_URL','TITLE']} """
		ListUrl = {	
					'Customer':				['CustomerEx',						'Customer'				],
					'LoanContract':			['LoanContractEx',					'Loan Contract'			],
					'LoanApplication':		['LoanApplicationEx',				'Loan Application'		],
					'BuyForeign':			['BuyForeignEx',					'Buy Foreign'			],
					'SellForeign':			['SellForeignEx',					'Sell Foreign'			],
					
				}
		return ListUrl

	def setConfigNotification(self):
		""" Syntax = {'URL' : 'TITLE'}"""
		ConfigNotification = {	
								'CustomerEx'			: 'Customer',
								'LoanContractEx'		: 'Loan Contract',
								'LoanApplicationEx'		: 'Loan Application',
								'BuyForeignEx'			: 'Buy Foreign',
								'SellForeignEx'			: 'Sell Foreign',
								'SourceIncome'			: 'Source of Income',
								}

		return ConfigNotification
